import React from 'react';
import './scss/app.scss';
import Header from './components/Header';
import Home from './Pages/Home';


function App() {

  return (
    <div className="wrapper">
      <Header />
      <div className="content">
      <div className="container">
        <Home/>
      </div>
    </div>
    </div>
  );
}

export default App;
